bno_random_0001.title: "관중의 잡음" # AI Tags
bno_random_0001.desc: "어둠 은 당신 의 성 의 험난 한 홀 들 을 지나가는 동안 당신 의 땅 을 점령 합니다. 어두운 밤 은 촛불 을 빠르게 필요 하게 합니다.\n\n누가 곤경에 처해 있습니까? 당신은 자신을 방어할 수 없습니다. 다른 사람을 말할 것도 없습니다. 그러나 당신의 본능이 당신을 인도합니다.\n\n공기 공기는 두꺼워지고, 아드레날린이 몸으로 튀어나오게 됩니다. [target2.GetFirstName].\n\n들여다보면 큰 암울한 인물을 발견할 수 있습니다. 작은 흰색 몸 위에 굽혀서 허벅지를 부딪히고...\n\n이 빨강해져서[target1.GetFirstName]그의 거대한 블랙 샤프트를 뚫고[target2.GetFirstName]그 반짝이는 고기를 다시 찔러내기 위해" # AI Tags
bno_random_0001.a: "내가 직접 만질 필요가 있어..." # AI Tags
bno_random_0001.b: "어쩌면 한 명 더 있을 수 있겠지?" # AI Tags
bno_random_0001.c: "이건 미친 짓이야!" # AI Tags

bno_random_1001.title: "관중의 잡음: 감시" # AI Tags
bno_random_1001.desc: "문에 누워서, 당신은 인내심을 가지고, 두 궁정관들이 순진하게 얽혀있는 것을 지켜봅니다.\n\n'네, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장, 젠장! [target2.GetFirstName]거의 노래하는 목소리로 말했다. 그녀의 발가락이 고, 다리가 어두운 남자의 몸을 둘러싸고.\n\n'어젠장 창녀야'. [target1.GetFirstName]방에서 달콤한 궁정관의 소음과 울음소리가 쏟아져 나오면서 그의 속도가 빨라지고, 정신없이, 당신의 손이 이미 당신의 드레스를 들어 올랐고, 두 개의 섬세한 숫자가 당신의 접구에서 멀어지고,\n\n'엄마... 이 똥을 구해줘' 그는 다시 짖고, 그 소녀의 작은 삐걱거리는 소리, 그녀가 질식당하고 있다는 것을 깨닫기 전에, 그녀의 취약한 목을 둘러싼 석탄 손은 거의 보이지 않습니다. [target2.GetFirstName]그녀의 몸이 굴복하고, 다리가 그녀의 손잡이를 단단히 하고,\n\n거의 그녀의 조율에 따라, 당신은 그 선두를 따르고, 당신의 다리가 조용한 울음 사이에 흔들리고, 내 thighs 당신의 기쁨으로 칠.\n\n가혹한 CRRACK! 가혹한 CRRACK! 가혹한 히프노스에서 당신을 자극합니다. 두 사람이 짝짓기를 보고, [target1.GetFirstName]아직도 뇌를 닦고 있어요" # AI Tags
bno_random_1001.a: "어째서 이렇게..." # AI Tags
bno_random_1001.b: "그래, 계속해" # AI Tags
bno_random_1001.c: "아니, 왜 내가 었지?" # AI Tags

bno_random_2001.title: "로딩 에 있는 잡음: 참여" # AI Tags
bno_random_2001.desc: "정해진 마음을 가지고, 당신은 당신의 존재가 즉시 알려질 것을 기대하며 문을 열고 있습니다. 대신, 당신의 코는 즉시 섹스의 냄새로 공격됩니다. 두 당사자가 침대에 얽매일 때까지 착용하고 있던 버려진 옷들을 발견합니다. 당신은 잠들기 전에 문을 습니다. 두 두 두 개의 두 머리 모두 빠르게 회전합니다. [target1.GetFirstName]심지어는 가죽을 꺼내버리는 것까지[target2.GetFirstName].\n\n하지만, 입술에 작은 미소로, 당신은 듀오에게 악보. '당신은 문을 열어 놓았다'.\n\n둘은 서로 잠시 눈을 주고받습니다. [target1.GetFirstName]고통스러우면서 자신의 창녀로부터 해방되고, 그녀의 가난한 똥이 그를 위해 조용히 간청합니다. '아빠,' 그녀는 , 손을 잡고 그의 팔을 가로지르며, 아프리카 이 서있을 때, 그의 완전히 세운 이 이제 당신의 즐거움을 위해 흔들리고 있습니다. 당신의 눈은 그것에 붙여있다, 옆에서 옆으로 흔들리는 것을 보고, 빛나는[target2.GetFirstName]손의 크기와 쉽게 일치하는 수분입니다.\n\n그의 손바닥 은 당신 의 손바닥 을 뻗어, 그의 입술 에 속박한 미소 가 있으며, 여전히 조금만 고 있다. '당신 은 그 를 즐기고 있는 것 같다'. 그는 웃고, 당신 의 뒤 에 문을 닫고, '피출'의 모든 기회 를 침묵 시키고 있다. 그의 손 들 은 잠시 동안 당신 의 몸 을 돌아다니고, 당신 의 드레스를 끌기 시작 하기 전 에, 당신 의 옷을 벗기도록 도와 준다.\n\n'뭐, [ROOT.Char.GetFirstName]그는 말 그대로 교수형에 처해있다는 것을 몰랐나요?'[target2.GetFirstName]그녀의 목소리가 울려 퍼지고 있는데, 지금 침대에 앉아 있고, 그녀의 손이 그녀의 다리 사이에 놀고 있습니다. 그녀의 연인은 당신을 벗고, 그 유연한 가슴을 벗고, 즉시 그들을 만지고 시간을 낭비하지 않습니다.\n\n'올라, 내가 네 인생의 시간을 줄게'. 그는 그 억양된 목소리로 부풀어, 거의 너를 녹여버린다." # AI Tags
bno_random_2001.a: "이것이 당신의 밤의 시작일 뿐이라고 합시다." # AI Tags

bno_random_0002.title: "가족 의 문제" # AI Tags
bno_random_0002.desc: "당신의 어깨는 긴장하고, 거대한 성의 전당에서 발가락이 clapping, 다른 모든 곳에서 침묵. 긴장 당신의 몸을, 꽃고래로 당신의 배가 붓고, 손을 함께 잡고, 당신의 보석에 놀고. 당신의 최고의, 흐르는 붉은 드레스를 입고, 당신은 자신의 옷장에서 선물을 요청하는 어머니에게 다가가는 것을 목표로, 당신의 오래된 브루치 말을 사고로 깨진.\n\n그녀의 방에 도착하면 깊은 숨을 쉴 수 있습니다.\n\n아무런 반응도 없이, 당신은 다른 쪽에서 오는 미묘하고 리듬적인 'THUMP THUMP THUMP THUMP'를 감지하기 전에 숨쉬고, 손잡이를 휘두르고, 문을 열고, 당신은 상상도 못했던 광경에 빠르게 노출됩니다. [target1.GetFirstName], 왕실의 존경받는 멤버, 당신의 어머니의 결혼을 황폐화하고, 그의 엉덩이를 그녀의 푹신한 엉덩이에 고, 원시적인 욕망으로 빠져나가고 있습니다.\n\n'네, 네, 네... 이거 가져가라, 망할 창녀야' 그는 울고, 그들의 사랑에서 오는 젖은 을 지켜보며, 무기력하게 그의 무력한 손이 그녀의 엉덩이에 강제로 내려올 때.\n\nCRRACK!\n\n'신여, 신여, 젠장, 젠장!'" # AI Tags
bno_random_0002.a: "이건 정말 스캔자스예요" # AI Tags
bno_random_0002.b: "엄마! 잠깐, 그녀가 날 봤어?" # AI Tags
bno_random_0002.c: "무슨..." # AI Tags

bno_random_1002.title: "가족 의 문제: 감시" # AI Tags
bno_random_1002.desc: "바로 그런 식으로, 그녀의 보석을 깨는 데의 변명을 찾으려고 노력하는 것은 당신의 마음에서 빠져나갔습니다. 엄마의 행복은 당신의 시선을 삼켰습니다. 강하고 탄소색의 남자가 침투하는 분홍색의 입술을 보면서. 그의 똥은 잘리지 않았으며, 당신이 익숙한 것과는 매우 다릅니다. 그의 공은 쉽게 당신의 이전 파트너의 두 배 크기입니다.\n\n'젠장, 젠장, [target1.GetFirstName]! K-Keep going! K-Kn-Knock me up!' 장글과 아기 열병에 걸려있는 늙은 여인은 불평합니다. 그녀의 나이에도 불구하고, 그의 둘레는 여전히 그녀의 똥을 뻗어 내기 위해 충분합니다. 일을 끝내기 위해 마지막 시간에 침몰합니다. 놀라, 당신은 단지 아가페 입으로 서 있습니다.\n\n천천히, 그는 자기 자신을 끌어내고, 네 엄마의 가슴에 가벼운 박수를 던지고, 이미 그의 남성적 씨앗을 저장하고 있습니다. 그 초콜릿 똥을 바라보는 대신, 당신의 '죄 없는' 눈은 그 여성의 덩어리로 끌립니다.\n\n또 다른 신발이 통로를 가로지르는 소리를 듣고, 당신은 빨리 문을 닫고, 가능한 한 신중하게 행동하고, 소박한 사정을 숨기려고 합니다." # AI Tags
bno_random_1002.a: "하지만 그 모든 거..." # AI Tags

bno_random_2002.title: "가족 의 문제: 잡혔습니다" # AI Tags
bno_random_2002.desc1: "드레스에 묶인 몇 개의 끈을 풀고, 당신은 당신의 매력에 대한 수용이 흑인의 날을 만드는 열쇠라는 것을 알고 있었습니다.\n\n처음에는[target1.GetFirstName]네 어머니가 경험으로 미소를 짓고, 손가락에서 씨앗을 빨리 청소합니다. '[ROOT.Char.GetFirstName]? '\n\n당신 은 대답 하지 않고, 그냥 웃으며 손 들 이 당신 의 드레스 의 어깨 를 몸 아래로 끌고, 당신 의 가슴 들 이 속옷 에서 빠르게 벗어날 때 '무?'라고 대답 합니다. 당신 은 자기 의 친척 보다 더 땀 을 흘린 남자 에 관심 을 가지고 대답 합니다.\n\n'엄마...' 남자가 직장을 마치고 손을 찌르며, 옷이 내려가며, 엉덩이를 드러내고,\n\n'아빠...' 네 엄마의 목소리, 너 둘을 쳐다보며, 여전히 똥을 고 있어. 그녀의 목소리로 무력화되어,\n\n'엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마...' '엄마'... '엄마' '엄마' '엄마' '엄마' '엄마' '엄마' '엄마' '엄마' '엄마'[target1.GetFirstName]네 입술은 그녀의 입구에서 굶주린 채 젖을 고 혀가 잔해를 고, 그 소금한 맛을 먹기 전에 그녀의 부드러운 손이 네 머리에 닿고, 그녀의 긴 손톱을 네 실크한 머리카락에 묶고\n\n'두 개의 작은 스노우파니'. [target1.GetFirstName]무즈, 당신의 무산 뒷부분에 박기를 내리는 것, 그것을 흔들리는 것을 보고, 당신의 입구와 그의 bitchbreaker를 정렬하기 전에. 손쉽게, 그는 당신의 어머니에 의해 기름부음 스틸로 슬라이드, 인치에서 인치, 그는 당신을 채우고, 벽이 그의 주위에 밀접하게 포장. '어젠장...이 똥이 너무 좋습니다'. 그는 고뇌, 또 다른 박기를 내리는 것, 다른 턱에\n\n발가락이 고, 발가락이 고, 발가락이 뛰고, 엄마처럼 널 채우려고 하고, 그의 끝은 자궁경부로 고, 그가 뒤로 물러나기 전에, [target2.GetFirstName]그 여자애가 그 삐걱거리는 백색 엉덩이에 을 을 때\n\n'엄마, 귀여워... 잘하고 있어~'" # AI Tags
bno_random_2002.desc2: "당신 의 어머니 의 애정 의 탐욕 이 당신 의 현실 을 흐리게 하고, 당신 의 아버지 를 제외 한 다른 사람 이 결혼 침대에 있을 것 을 너무 간절 히 원하는 것 같다는 것 으로 완전히 놀랐습니다. 당신 은 정치 의 영역 에서 성적 관계 가 혼란 스럽다는 것을 알고 있었지만, 당신 의 어머니 가 낮은 출생 으로 잠자리는 것 을 상상조차 할 수 없었습니다.\n\n거의 떠나기로 결심했지\n\n네 엄마가 몸부림을 올릴 때, 엉덩이를 내려다보죠. [target1.GetFirstName] '아, 너'. 그의 목소리는 부풀어지고, 당신의 관심을 빠르게 끌고, 당신의 존재를 연인들에게 드러내고 있습니다.\n\n그 남자가 달릴 뻔한 것 같았어요. 당신이 서 있는 동안, 문 앞에 얼어붙어있었죠. [target2.GetFirstName]이 사실을 깨닫고, 침대 시트를 뒤섞고, 네 눈을 알아차린다'. [ROOT.Char.GetFirstName] '아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아아'[target1.GetFirstName].\n\n'엄마?' 당신은 외치, 문을 조금 더 열어, 거의 헤드라이트에 도인처럼.\n\n'네, 아뇨, 아뇨, 아뇨, 아뇨, 아뇨, 아뇨, 아뇨, 아뇨, 아뇨, 아뇨, 아뇨, 아뇨, 아뇨'\n\n시야에 사로잡혀서 서두르며, 몇 걸음 들어갔고, 어머니가 지시한 대로 문을 닫고, 럭셔리 매트러스에 접근하면, 네 다리가 떨리는 것을 느낄 수 있습니다.\n\n'시어... [ROOT.Char.GetFirstName] '어리 와!'라고 그녀는 빠르게 대답하고, 당신을 침묵시킵니다. 그녀의 팔을 뻗어, 그녀는 그녀의 손가락에 매끄러운 씨앗을 보여, 그녀의 입술에 미소를 짓습니다. 한 마디도 하지 않고, 당신은 본능적으로 당신의 입을 열고, 그 섬세한 손가락들이 당신의 덩어리, 체리 붉은 입술을 지나가도록 허용합니다.\n\n'그냥 그런 것 같아' 그녀는 울며 너 너 너 너 너 너 너 너 너 너[target1.GetFirstName] '어머니의 품에 누워라. 네 새 형제의 아버지께서 뭔가 보여줘." # AI Tags
bno_random_2002.a: "내가 고 있어!" # AI Tags

bno_random_0003.title: "비밀 정원은" # AI Tags
bno_random_0003.desc: "온화한 바람은 긴 나무의 잎을 고 있습니다. 당신의 가족의 조용한 정원을 고 있었습니다. 이 정원은 바로 당신이 자랐고 자랐던 정원이었습니다. [target2.GetFirstName]앵무새들은 정원 안에서 '폭풍'이 불어오는 것을 반조하며 ಶಾ뭇가지들 사이에서 조용하게 윙윙윙합니다.\n\n부드러운 속삭임 의 속삭임 은 귀 를 장식 하고, 목소리 들 을 감지 할 때 위로 솟아 나갑니다. 조심 스럽게 잎 의 일부 를 옆으로 밀어 넣고, 충격적 인 장면 을 목격 하기 위해 눈을 감습니다. [target2.GetFirstName]그리고 그녀는 혼자가 아니었습니다. 사실, 그녀 위에 올라섰고, 그녀의 팔에 묶여있었고, 그의 피부색으로 유명한 궁중이었습니다.\n\n당신은 잠자리를 시도하지 않습니다, 당신의 눈은 그들의 상호적인 애정을 훈련, 당신의 여동생의 분홍색 입술 녹는[target1.GetFirstName]실로 그의 혀가 그녀에 강타하여 그녀의 귀에 따뜻함이 들게 되나니 네가 그 장소로부터 조금만 떨어져 있을 때 그의 손들이 그녀의 몸으로 향하고 그녀의 구부러진 허벅지를 지나가며 그녀의 뒤편으로 향하는 것을 보라 보라 그는 갈색색 바지를 입고 그의 발바닥을 뚫고 있으며 그의 눈에는 성욕이 있더라" # AI Tags
bno_random_0003.a: "왜 그런지 이해해[target2.GetFirstName]좋아하지만, 그냥 맡겨야 돼" # AI Tags
bno_random_0003.b: "[target2.GetFirstName]제발, 나랑 같이 가자!" # AI Tags
bno_random_0003.c: "[target2.GetFirstName]무슨 짓을 한 거야?" # AI Tags

bno_random_2003.title: "비밀 정원: 침투" # AI Tags
bno_random_2003.desc: "당신 의 울음소리 는 이 쌍 을 찢어 낸다. 그 들 의 입술 에서 서로 의 입술 으로 이어지는 침줄 이 있습니다. 하지만 당신 은 그 를 거의 눈치채지 못 합니다. 당신 의 목소리 에서 구부짖는 소리 와 당신 의 눈 에는 절망 이 있습니다. [target1.GetFirstName]그의 형제들 중 몇몇은 당신의 몸의 감각과 눈에 띄는 유연성을 언급했고\n\n[target1.GetFirstName]그의 입술에 작은 미소, 그의 이 이미 그의 바지를 뚫고, 그의 뒤에서, 당신의 여동생은 소리치고, 거의 그를 두 사람 사이에 보호자로 사용. 비록, 당신의 코르셋은 확실히 그를 무력화,\n\n'여러분 이 둘 다 혈통 을 암흑 시키고 싶어 하는 것 을 누가 생각 했습니까?'라고 조롱 하면서, 손 을 턱 에 올려놓고, 당신 의 여동생 은 조금 당황 하게 됩니다. 하지만 당신 의 열망 은 다른 것 을 증명 할 수 있도록 도움 이 되었는데, 손 들 이 끈 을 능숙 하게 잡고, 코르셋 을 느슨 하게 하고, 왕 의 의복 을 벗는 데 도움 이 되었습니다.\n\n'나와 내 여동생... 논의해야 할 문제 있어요'. [target2.GetFirstName] '그래서 난 그녀에게 용의를 하려고 해요'. [target1.GetFirstName]닭이 포착된 상태에서 빠져나가고 있고, 이미 똥을 흘리고 있습니다.\n\n'Hmph. '그는 모두 대답하기 전에, 당신이 두 사람을 화석 벤치로 이끌고, 당신은 빠르게 그것을 굽혀, 당신의 빛나는 똥 입술을 벗고. '나는 우리가 오늘 밤이 완료해야 할 것 같다, sluts'. 그는 어, 그의 목소리 husky, 그의 거친 머리는 빠르게 당신의 붓은 입에 밀고, 당신의 여동생 strips 아래로 당신을 열고.\n\n'그녀에게 가까이 가세요. [target2.GetFirstName] '그 엉덩이를 보고 싶어요'. 그는 더해 줍니다. 그의 똥이 당신 안에 들어있지 않은 상태에서, 다시 뒤집어, 앞뒤로 기 시작합니다.\n\n'너도 흑인이니?'" # AI Tags
bno_random_2003.a: "젠장, 그래, 젠장, 젠장!" # AI Tags

bno_random_0004.title: "미친 레이지" # AI Tags
bno_random_0004.desc: "'오후 12시 직전'라는 명명서 는 색 잉크 로 되어 있으며, 이 장편 의 상호 는 이 장편 의 바닥 에 표기 되어 있다. 보통, 이 장편 의 경우, 이 장편 의 시간 을 정하여 이 장편 을 만나게 될 것 이다. 그 대신, 이 장편 의 경우 큰 실수 로 인해 이 장편 의 법정 에 초대 당하고 있었다. 당신은 일요일 의 장갑, 활기찬 녹색 의복, 루비 크로스 목걸이, 은 팔찌, 그리고 당신 의 옷장 에 있던 모든 것 을 입고 있었다. 침묵 으로, 당신 은 옷장 에 있는 모든 것 은 충분 한 것 을 희망 하였다. 당신은 왕좌 방 으로 가는 길 을 찾았다.\n\n하지만, 당신 앞의 장면 은 완전 한 타락 의 장면 이다. 이렇게 말도 안 되는 일 을 예상 하지 못한 채, 당신 의 눈 이 넓어지는 것 이다. 당신 은 당신 의 릴리지를, 그녀의 뒤 에 털이 덮여 있는 것 을, 그녀 에게서 나오는 불쾌 한 소리 들 을 보게 될 것 이다. 당신 은 일찍 도착 하였지만, 당신 의 릴리지는 이 새로운 난민 들 에 대해 그렇게 집착 할 것 이라고 생각 하지 않았습니다!\n\n그러나, 당신 은 자신 을 도울 수 없습니다. 당신 의 은 밝은 붉은 색 으로 바뀌고 있습니다. '내 !'라고 당신 은 요구 합니다. 당신 의 몸 은 이상 한 분노 로 불어 타고 있습니다. '무엇 을 하고 있습니까?' 그러나, 그녀가 자유 를 얻으려 할 때, 그녀의 앞 에 앉아 있는 남자 는 미소 를 짓고, 그녀의 머리를 낮추고, 그녀의 을 고 있습니다. [bno_bbc|E]더 이상 당황스러운 현장에서 머물지 못하면서도 여전히 놀랐습니다." # AI Tags
bno_random_0004.a: "저 남자가 누구라고 생각하니?" # AI Tags
bno_random_0004.b: "이 영역은 미쳤어!" # AI Tags

bno_random_1004.title: "미친 거짓말: 당신에게 노출" # AI Tags
bno_random_1004.desc: "로트의 아내 가 사도마 과 고모라 를 떠나고 있는 것 처럼, 혹은 오르푸스 가 사랑 한 사람 을 찾기 위해 돌아가는 것 처럼, 당신 의 부드러운 눈 들 은 다시 한 번 그 현상 을 바라보고, 그 사람 이 그 여자 의 목 의 한계 에서 벗어나는 것 을 지켜보며, 지금 당신 이 볼 수 있는 그의 두꺼운 검은 수컷 똥 을 펌프 하고 있습니다.\n\n그는 한 엉덩이를 고, 고 고 고 고 고 고 고 고 은 끈이 당신의 의 얼굴에 기 전에, 그의 음량에 놀랐고, 또 다른 열여섯 개의 끈이 그 뒤를 따라갑니다. [target1.GetFirstName]당신을 보세요, 기쁨으로 머리를 뒤흔들기 전에, 그의 연인은 그녀의 손과 입술을 사용하여 작업을 완료합니다.\n\n'어머... 쇼를 보여줘'... '그녀의 콧수염 위에 있는 남자가, 그녀가 무엇을 했는지 알게 되면서 웃으며 그녀를 떠났어요. 또 한 번 더 엿보지 않으면, 당신은 당황하게 부당함에서 도망치고, 당신의 양변은 부끄러움으로 빨라집니다." # AI Tags
bno_random_1004.a: "적어도 그녀는 이 문제에 대해 솔직하다" # AI Tags

bno_random_2004.title: "미친 거짓말: 감정 을 감추는 것" # AI Tags
bno_random_2004.desc: "당신은 거의 시간을 낭비하지 않습니다, 당신의 리지의 마취와 마취의 소리가 법원을 가득 채우고, 마침내 들리는 '팝'으로 끌고. 그녀는 그녀의 연인이 하루의 시간을 제공하지 않습니다. 그러나, 그는 그녀의 머리를 가만히 유지 하 고, 그녀의 얼굴에 짐을 타는 등으로 돌아.\n\n'[ROOT.Char.GetFirstName]그 여자 는 당신 을 잡기 위해 발자국 을 찌르며 소리 지르다. '그것 은 그렇게 보이지 않는다!' 그녀는 이렇게 덧붙인다. 그녀의 멋진 발자국 한 발자국 이 뒤집어지고 튀어나오면서 거의 새로운 메이크업 세트 를 가지고 멋진 타일 에 뛰어들게 되었습니다. [target1.GetFirstName]이니까\n\n당신 뒤에 문을 고, 당신은 조롱하고, 심지어 바닥에 있는 문장을 던져버립니다." # AI Tags
bno_random_2004.a: "여신여! 그리고 나는 프로젝션을 하지 않는다." # AI Tags

bno_random_0005.title: "검은 목욕탕" # AI Tags
bno_random_0005.desc: "오랜 주 동안 궁정 의 직무 를 수행 한 후, 당신 의 사물 들 이 이미 뭉쳐져 있고 뭉쳐져 있는 상태 에서 잘 마땅 한 목욕 을 하고자 합니다. 어느 정도 휴식을 취 하고자 함 으로 왕실 목욕 하우스 로 내려가며, '여자' 시간 이 시작 되기 직후 얼마 지나지 않아 도착 합니다. 머리 를 내려 놓고 화장품 을 지우고 옷을 벗기기 시작 하는 것 들 을 준비 할 때, 당신 의 눈 들 은 이미 완전히 벗겨져 있는 당신 의 눈 에 달려 있는 집 의 한 모퉁이에 더 어두운 피부 가 달린 인물 이 왈츠 하고 있는 것 을 보게 됩니다.\n\n처음엔 네 눈은 서로 만나는 길을 횡단하고, 둘 다 잠시 방황하기 전에 네 눈은 절대적인 코끼리의 똥줄로 내려가며, 그의 눈은 네 유연한 가슴을 볼 수 있습니다. [target1.GetFirstName]어색하게 변하고, 그의 몸은 땀과 증기로 빛나고,\n\n'죄송합니다'. 그는 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어 어\n\n네 입은 물을 피하지 않을 수 없어, 사실상 이미 그를 위해 벌거벗은, 그냥 자신을 보여주기 위해 손을 멀리. '당신은 좋은 창녀처럼 내 똥을 잡을거야?'\n\n당신의 눈은 급속히 올라갑니다. 그가 지금 당신 앞에 서 있는 것처럼, 그의 깎은 몸은 유혹에 너무 큰 것입니다." # AI Tags
bno_random_0005.a: "- 그래요" # AI Tags
bno_random_0005.b: "경비원!" # AI Tags

bno_random_1005.title: "검은 목욕: 좋은 여인이 되는 것" # AI Tags
bno_random_1005.desc: "그는 웃으며 손바닥을 들고 부드럽고 멋진 머리카락을 껴안고 어깨를 만지고 긁습니다. '좋은 소녀'.\n\n네 척추가 그 말을 듣고 떨고, 네 다리가 본능적으로 낮아지고, 무릎에 떨어지고, 네 옷이 발에 찌그러져 있다. 이 각도에서, 네 머리는 그의 똥과 함께 있고, 눈은 그 똥의 발자국과 생명으로 뛰는 것을 볼 수 있다. '하느님...' 당신은 울고, 가슴에서 손을 들고, 분홍색 콧수염을 드러내고, 따뜻하고 둥근한 고기를 조금 끌어내기 위해. 그것은 당신이 상상할 수 있는 모든 것입니다.\n\n'무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...무...\n\n'GLLLRRRKKK!' 당신은 을 하고, 그가 을 때 약간 을 것입니다. 분명히, 그는 당신의 투쟁을 즐기고, 당신이 그에게 질식하는 것을 보고, 필요하다고 생각하면 얼굴에서 털만 을 것입니다. 다시 한 번하면, 그는 당신을 하고 울리게 합니다. 얼굴을 기 시작합니다. 당신의 코를 그의 덩굴 뼈에 밀고, 그의 공은 당신의 턱에 박수합니다. 당신은 그의 잔인함에 의해 눈물을 흘리는 동안 땀과 침이 무엇인지 알기가 어렵습니다.\n\n'먹어...먹어...먹어...먹어' 라고 울고, 너한테서 손쉽게 끌어내기 전에, 엉덩이를 다듬고" # AI Tags
