bno_random_2010.desc: "그 시야를 보고 서둘러 골목을 둘러보며[target1.GetFirstName]겁에 질렀고, 복수를 두려워서 검은 엉덩이를 바지에 넣을 뻔했지만, 당신이 그의 손을 잡으면, 당신은 그를 원한다는 것을 알고 있습니다.\n\n'이곳은 아니죠!' 라고 소리치고 흙을 쳐다보며 드레스를 훼손하고 싶지 않거나[target1.GetFirstName]그는 머리를 숙이고, 길을 따라 목욕탕으로 인도합니다. 자신의 가게를 떠나 당신의 궁전에서 자리를 잡는 것은 확실히 헌신입니다.\n\n너희 둘은 빨리 함께 텐트를 찾게 되는데, 네 남자가 방으로 몰래 들어가서[target1.GetFirstName]옷을 벗고 옷차림을 벗고 바지를 무릎까지 끌어내죠. 당신은 같은 일을 합니다. 대신, 당신의 을 거의 지지하지 않는 테이블에 뛰어 올라갑니다. 바지를 끌어내리고 을 내려놓습니다.\n\n'어젠장'. 그는 비밀로 행동하려고 속삭인다. 그는 당신의 똥을 당신에게 밀고, 당신의 똥은 배고픈 그를 빨아 넣고, 당신이 전에 잠들었던 남자에도 불구하고 여전히 꽉 찼습니다. '그리고 나는 단지 감옥에 있을 것으로 예상했다'. 그는 웃고, 그의 엉덩이를 회전 당신의 손을 두쪽 머리를 잡고, 키스 한 번을 위해 그를 데려다.\n\n느려지고 통제할 수 있게 하고, 엉덩이를 네 쪽으로 고, 그 귀여운 똥을 천천히 고, 키스를 통해 애를 고, [target1.GetFirstName]당신의 내면을 흰색으로 칠하고 그의 아기들과 함께\n\n그는 숨을 고, 'schlrp!'로 꺼져 내려다보며, 당신께서 그로부터 뽑아낸 비틀거리는 씨앗에 놀랐습니다. '어젠장'. 그는 비틀거리고, 숨쉬고, 그가 아마도 그의 을 임신한 것 같다는 것을 깨닫습니다. 한 손은 당신의 턱을 만지고, 당신의 입에 다른 사랑스러운 키스를 심고, 그의 똥을 바지에 넣기 전에." # AI Tags
