bno_random_2012.desc: "'다른 사람?' 그는 눈을 올리고 반짝짓습니다. '젠장, 소녀'. 그는 캠프를 잠시 둘러보며 덧붙인다. 그는 당신의 뒤를 따르기 위해 두드러기 전에 입술을 습니다. 그 가슴을 다시 한번 볼 수 있습니다. '예. 나는 Gotchu'.\n\n당신들의 여행은 당신들을 수용소 한가운데로 데려갑니다. 지금 캠프불 앞에, 또 다른 난민은 절단된 나무 위에 몸을 숙이고 빵을 뜯어먹고 있습니다. 하지만 당신 둘 다 가까이 갈 때, 그의 시선은 올라가고, 즉시 당신들의 흔들리는 가슴에 앉습니다. [target1.GetFirstName]당신을 이끌고 있습니다.\n\n'[target1.GetFirstName]누가...?\n\n'완전해, 두 형제를 찾고 있어'\n\n즉시, 공기는 바뀌고, 새로운 남자가 당신이 도착한 것은 당신이 잡히고 있는 것이 아니라 듀오를 위해 자신의 몸을 기꺼이 포기한다는 것을 깨닫습니다. 몇 번 깜박이는 불에 있는 남자는 당신에게 다가와서 자세히 보기 전에 적응하는 데 잠시 걸립니다. 찢어진 호흡은 그를 떠나고, 손을 내밀고, 당신의 '외국적' 가슴을 뜯어먹습니다.\n\n몇 초 안에, 당신의 옷은 검으로 찢어진다. [target1.GetFirstName]네 맨몸이 두가지와 대조하고 있어[target2.GetFirstName]머리를 묶고 똥끝까지 안내하고[target1.GetFirstName]네 뒤에 서 있어, 이미 네 긴, 분홍색 똥구멍에\n\n'좋은 창녀야'. [target1.GetFirstName]다른 아프리카의 똥에 질식하고, 다른 아프리카의 똥에 질식하고, 당신의 종들이 구석에 당신을 찾고 있을 때, 당신은 현재 두 개의 목동 사이에 지나가고 있었고," # AI Tags
