bno_random_0013.desc: "당신은 편안하게 침대 방에 누워서 주변의 풍요로움을 즐기고, 갑자기 혼란이 그 순간의 안정을 깨뜨리고, 문이 열리고, 놀라움으로, 거의 벌거벗은 네 명의 흑인 남성들이 방으로 침투합니다. 그들의 리더, [target1.GetFirstName], 과감한 자세로 앞으로 나아갑니다.\n\n'잠깐! 우리는 당신의 궁전을 우리의 존재로 장식하기로 결정했습니다. 당신은 내 동료들을 기쁘게하고 그들이 당신과 함께 살도록 허용 할 것입니다! 당신은 내 말을 잘 들었다! 우리는 숙박을 요구하고, 그 대가로, 우리는 당신의 궁전에 아프리카 문화를 소개 할 것입니다. 공정한 무역, 당신은 생각하지 않나요?'\n\n네 남자 들 은 모두 당신 에게 다가오기 시작 하고, 그 때 에 그 들 이 '복옷'으로 입는 작은 옷 아래 에서 무엇을 포장 하고 있는지 알 수 있게 되는 것 이다. 그 들 의 거대 한 검은 수컷 들 은 거의 세 번째 다리 처럼 그 들 아래 에 매달려 있는 것 이며, 그 들 은 당신 을 놀라게 한다." # AI Tags
