bno_random_1014.desc: "결혼식 은 거의 결혼식 처럼 시작 되었습니다. 당신 의 궁정 들 과 손님 들 은 모두 초대 되었으며, 당신 의 일부 비사 들 도 초대 되었읍니다. 그 들 은 참을성 있게 기다렸으며, 그 들 의 긴장 을 완화 시키기 위해 음식 과 음료 를 제공 하였습니다. 그 들 이 보낸 법령 은 구체적 으로 어떤 것 도 알려지지 않았으며, 단지 '중요한 선언'이 있을 것 이라고 말 하였습니다.\n\n하지만, 그들은 결코 예상하지 못했던 일이었습니다. 모든 사람들 앞에 서서, 당신은 미소를 짓고, 당신의 사랑하는 사람과 팔을 연결하고, 몇몇 인종차별주의자의 얼굴에 명백한 경멸을 느꼈습니다.\n\n남편은 목을 닦고 군중을 침묵시키죠\n\n'오늘 저는 여러분 모두에게 새로운 왕을 선포합니다. [target1.GetFirstName]새로운 통치의 시작!' 당신은 웃고, 돌고, 가슴을 열고, 그로부터 화려하게 꾸며지고 독특하게 만든 왕관을 뽑아, 당신의 연인의 머리에 놓습니다. 몇몇은 박수를 치지만, 심지어는 몇몇은 다음으로 무슨 일이 일어날지 짐작할 수 있었습니다. 왕조적 도전의 행동으로, 당신은 무릎을 꿇습니다. [target1.GetFirstName]머리를 숙이고, 손을 접는 동안\n\n'그리고 새 신에게'. 당신은 지금 위로 쳐다보고, 두 손을 그의 덩어리에 놓고, 조금 끌어들이고, 교도회와 신자들로부터 기쁜 소리가 들리고, 놀라움을 당하기 전에, 당신의 새로운 신부는 이제 그의 바지를 끌어내고, 그 어두운 초콜릿이 당신의 얼굴에 떨어지고, 거의 뇌진탕을 일으켰습니다." # AI Tags
