bno_random_0017.title: "보호 가격" # AI Tags
bno_random_0017.desc: "당신은 정오 수영을 마치고 머리가 찢어지고 목욕복이 벗겨진 상태에서 마르고 있었습니다. 성장 안에 있는 그런 자연스러운 침수수욕장에 접근할 수 있는 것이 즐거웠고, 과감하게 받아들이지 않은 특권이었습니다. 머리를 말줄에 넣고, 방의 문을 두드리는 소리를 듣습니다.\n\n그러나, 당신은 심지어 가서 잠재적인 손님들을 허용 할 필요가 없습니다. 그들은 그것을 스스로 받아들였습니다. 당신이 대답하기 전에, [target1.GetFirstName]당신의 엘리트 경비원 중 한 명, 당신이 옷을 입었는지 여부에 상관없이 문턱을 통과합니다. '마디, 거기 있습니다'. 그는 멈추고, 그의 눈은 당신의 자연스러운 아름다움에 집중하고, 당신의 벌거벗음을 놀라게합니다. 그의 의도는 그렇게 순수하지 않습니다. 그러나, 그는 다시 문을 넘어, 그 뒤에 닫습니다. [target1.GetFirstName]한 초 동안 눈은 조용히 간청하고, 한 손은 가슴을 덮고, 다른 손은 아래쪽 영역을 숨기려고 아래쪽으로 비추고 있습니다. ' D- damn... 죄송합니다'. 그는 여전히 떠나기 위해 움직이지 않고 대답합니다. 대신, 그는 당신을 계속 확인합니다.\n\n이제 어쩔 수 없는 일이었습니다. 당신의 은 사과처럼 빨습니다. 그는 호기심에 힘입어 앞으로 한 걸음 나아갑니다. 그러한 금지 된 맛을 갈망하고 있습니다. '제 리제...' 그는 지금 습니다. '미안해요. 하지만... 확실히 당신이 내게 주는 모든 시선을 부인할 수 없습니다'. 그의 목소리는 부드럽고, 지금 당신 앞에 서 있는 그는 당신의 맨 어깨를 만지고 있습니다. '당신의 자신의 충동은 당신을 배신합니다'. 그는 웃고 당신의 어깨를 낮추고 있습니다." # AI Tags
