bno_random_0018.title: "그리고 튜?" # AI Tags
bno_random_0018.desc: "'세권? 나는 생각하지 않는다'. 당신은 당신의 보런 중 한 명에게 명령하고, 당신의 경호가 그를 데려가는 것을 지켜보고, 곧 자신의 귀족에게 소식을 전하도록 명령합니다. 그들은 또한 그들의 공정한 몫을 지불해야 합니다. [target1.GetFirstName]손목 을 잡아서 함께 묶어 두는 것 이다. 본능적 반응 으로, 당신은 당신의 손을 끌어 당기려고 노력 합니다. 강경 한 경호자 를 바라보며, 그의 눈 에 악의적 한 시선이 있습니다. 다른 손 이 당신 의 입술 을 완전히 침묵 할 수 있기 전 에, 다른 손 이 당신 의 입술 을 떠나고, 당신 의 목 에 한 손 을 감싸고 있습니다. 당신 의 경호자 는 당신 을 돌 벽 에 밀어 넣고, 당신 의 목 을 울리지 않게 하기 위해 충분히 압력 합니다.\n\n오직 지배적 인 콧물만이 그의 코 구멍 을 남기고, 당신 위 에 솟아, 몇 초 동안 당신 의 눈 에 쳐다보며, 마치 '이제 당신 을 잡았다'고 말 하는 것 처럼요. '다른 손 이 일어나서 당신 을 눌러 주려고 합니다. 운이 없는데, 그 손 은 당신 에게 부드러운 콧물 을 주고, 당신 을 주의 를 기울여 주도록 강요 합니다. '투쟁 하지 마십시오'. '그 는 고무 하고, 당신 의 두 손목 을 한 손 한 손에 묶어 두 손목 을 머리 위 에 쥐고 있습니다.\n\n즉, [target1.GetFirstName]그는 웃고, 당신의 목에서 손을 떼고, 당신을 뽀뽀로로 침묵시키고, 그의 이제 자유로운 손이 당신의 옷을 끌어 당기고, 대략적으로 당신의 속옷과 놀고 있습니다. 어떤 흰 똥보다 쉽게 큰 두 자릿수, 당신의 입구에 긁어, 천과 마찰을 유발합니다. 즉시, 당신은 진정하고, 당신의 심장이 여전히 뛰고 있습니다. 당신은 당신의 신뢰할 수 있는 경비자가 당신의 입술을 떠나며, 욕구로 가득 찬 눈을 침묵합니다. '너무 많은 소음을 만들지 않도록 노력하십시오'. [target1.GetFirstName]그의 목소리는 부드럽고 부드럽다.\n\n그 때야 그는 당신의 레시 속옷을 벗고, 그의 똥이 그의 바지에 다이아몬드처럼 단단합니다." # AI Tags
