bno_random_1018.title: "에트 투: 잔인한" # AI Tags
bno_random_1018.desc: "[target1.GetFirstName]그는 당신의 입장을 채우면 다시 당신을 질식시킬 것이라는 것을 알았기 때문에 당신의 말을 지켜줄 것이라고 의심하지 않았습니다. 그의 입장은 무례적이었고, 당신의 분홍색 입술이 그를 삼키면서 가장 당황한 비명을 지었습니다. 당신의 경비자는 당신의 입술에 적당한 길이를 밀어 넣기 전에 몇 번만 을 필요가 있습니다. 그의 악성적인 미소는 그의 입술에 형성됩니다. 그의 손이 당신의 목에 다시 비추고, 당신의 식도통에 압력을 가합니다. '부탁합니다'. 그는 괴롭히고, 당신이 을 할 수 없다는 것을 잘 알고 있습니다.\n\n[target1.GetFirstName]그의 속도가 빨라지고, 그의 허벅지를 당신의 편견으로 밀어 넣습니다. 그가 남는 유일한 것은 그의 원시적인 비틀거림과 '당신의 혈통을 끝내는 것'과 '당신을 검게 만드는 것'과 '당신의 왕조의 종말을 보장하는 것'에 대한 발언입니다. 오히려 어두운 것들, 당신은 산소 부족이 당신의 뇌에 도달하는 것을 느낄 수 있습니다. [target1.GetFirstName]하지만, 예상대로, 분노한 숨결을 제외하고는 아무것도 남지 않습니다. 당신의 은 빨강해지기 시작합니다.\n\n'네...네... 네...' 그는 거리에서 손을 꺼내서 잠시 숨을 쉬게 하고, 딱딱한 손바닥으로 뱉어내기 위해 '그 엉덩이를 가져라'. '그 엉덩이를 찌르라'. 그는 브루투스가 카이사르를 찌르던 것처럼 자궁경부뼈를 찌르며 찌르며 찌르죠. 하지만... 이것은 훨씬 덜 폭력적인 방식으로였죠. 보디가드의 다리는 떨며 오르가즘에 가까워지고 있습니다. 그의 잡은 것은 당신의 목을 찌르면서 엉덩이를 찌르며 당신의 속을 찌르며 찌르죠. 그는 몇 초 동안 뛰고 있습니다. 발톱의 소리가 당신의 방향으로 떨어지기 전에. 당신의 입에 사랑스러운 키스를 찌르며, 그는 밖으로 나가서 바지를 찌르며, 그의 아이들이 당신의 엉덩이 아래로 달려가는 것을 허용합니다.\n\n'제여?' 목소리가 울고, 당신을 보기 위해 코너를 돌고, 혼란스럽고 약간 혼란스럽고, [target1.GetFirstName] '오, 죄송합니다, 부인. 병든가요?'" # AI Tags
