bno_random_0020.title: "눈 을 즐겁게 하는 것" # AI Tags
bno_random_0020.desc: "신부님께서는 여러분들을 그의 유적에서 저녁식사에 초대하셨고, 예상대로 여러분들은 매우 흥분하고 있습니다.\n\n파티는 음악가의 리라와 편안한 목소리로 시작되었습니다[target2.GetFirstName]그 다음에는 빛의 축제가 일어났습니다. 정말 위대한 승리의 밤에만 제공되어야 하는 철저한 네 가지 식사입니다. 이런 오래된 밤은 아닙니다.\n\n하지만, 아마도 오늘 밤은 특별한 밤이었죠. [target1.GetFirstName]당신은 종종 많은 사람들의 관심을 끌었지만, 이 사람은... 다른 것 같았습니다. 그의 눈은 당신을 삼키려는 의도를 보였다. 심지어는 당신이 그에게 작별 짝짓기를 하거나 관대적인 파장을 할 때에도. 그의 어두운 피부는 거의 악의적인 것을 반영하고, 그의 높이는 공포를 더했습니다.\n\n파티가 끝나고, 배가 고기로 가득 차 있을 때, [target1.GetFirstName] '내 여주님', 그는 그의 목소리가 거칠고 찢어지고, 얼굴의 흉터처럼, '나는 당신의... 빈번한 시선을 눈치채지 않을 수 없었다'. 그는 웃고, 놀고, 그를 먹이는 웃음. 그는 당신에게서 약 1피트 떨어져 있으며, 너보다 높습니다. 당신의 입술은 그의 인사에 대한 보상을 필요로 춤추고 있습니다." # AI Tags
