bno_random_0021.title: "순결 한 사람 을 징계 하는 것" # AI Tags
bno_random_0021.desc: "'하나님, 예!' 당신은 외치며, 당신의 긴 손톱이 당신의 연인의 등에 톱을 고, 그가 당신에게 강요했던 고통의 일부를 파헤치고 있습니다. [target1.GetFirstName]윙스, 두 마리의 손을 들고 얼굴에 떨어뜨리고 그의 손바닥이 당신의 을 찢어 놓습니다.\n\n'어머리 닥쳐'. 그는 공격적으로 울고, 당신이 을 일으킨 것과 같은 손을 잡고, 목에 싸고, 뇌에 혈류를 좁히고. '당신은 더 잘 알고 있습니다, 망할 소리, 창녀'. 그는 밖으로 내보내고, 혐오스러운 헛소리 그의 입에서 을 때 당신의 사용 된 똥. 그의 공은 당신의 거품 엉덩이에 claps, 당신의 똥은 이미 분홍색으로 때렸다.\n\n당신은 비명을 지으며 울고 있는 동안 그는 입에 침을 뱉고, 허벅지를 아래쪽으로 뻗어, 자궁경부로 가장 잘 맞을 수 있게 해줍니다. [target1.GetFirstName]웃으며, 당신의 벽은 그를 팔찌처럼 붙잡고 있습니다. '예... 예... 아빠라고 부르세요'. 그는 웃음으로 따돌리고, 당신의 에 또 다른 가혹한 CRRACK를 전달합니다.\n\n이 소리들은 자연스럽지 않은 소리였고, 당신의 관장 중 한 사람의 관심을 끌었습니다. [target2.GetFirstName]의문의 문을 열고 그의 눈은 당신의 희미한 모습으로 가득 차 있습니다. [target1.GetFirstName] '내 신부님!' 그는 소리를 지르며 놀라며 목소리를 높였다. 다행히도, 그는 이미 당신의 사회에서 자신의 위치를 보여줬습니다. 그의 다리 사이에 적절하게 처리되었습니다.\n\n즉시, [target1.GetFirstName]손들이 목에서 떨어지고 숨을 쉬는 동안 침입자의 모습을 볼 수 있게 해줍니다'. [target2.GetFirstName] '당신은 삐걱거리고, 조금만 일어나서 몸을 벌거벗고, 땀과 땀으로 덮여 있습니다. '이것이 아니죠'.\n\n빨리, 당신은 당신이 정당한 정의를 퍼뜨린 많은 사람들 중 하나라는 것을 깨닫습니다. 신성한 순결은 당신의 인종을 끝낼 것입니다." # AI Tags
