bno_random_0022.desc: "당신 의 주간 '순례'이 당신 의 주역 의 성전 에 항상 열매 를 맺는 것 이다. 목 에 달린 분자리와 매달려 있는 십자가 목걸이 는 항상 당신 에게 좋은 예언 을 하는 것 이다. 그러나 교회 에 도착 할 때, 당신 의 더 어두운 피부 가 있는 난민 이 돌고 다니는 것 을 발견 한다. 말 말 을 받아들이는 것 이다. 실제로 그 사람 에게 많은 관심 을 기울이는 사람 은 없다. 하지만, 당신 의 무한 한 호기심 으로, 당신 은 그 에게 접근 한다.\n\n'하느님 은 검은 것 입니다. 하느님 은 검은 것 입니다!'라고 외치며, 당신 의 눈 은 그분 의 불명예 한 모욕 에 휩싸인 것 입니다.\n\n'주님! 주님! 제발, 진정 하십시오!' 당신은 머리를 흔들고 그를 간청합니다. 거의 즉시 당신의 진정하는 목소리에서, 그는 자신을 릴, 그의 미친 외모가 가라앉는, 당신이, 아쉽게도, 그를 엔터테인먼트 있다는 것을 깨닫고. '당신은 무엇을 의미 할 수 있습니다?' 당신은 그에게 묻습니다.\n\n'내가 말 하는 것 은... 당신 은 그리스도 의 기원 을 알지 못 합니까? 예루살렘 에서 왔는가? 그는 사하라 와 이집트 의 혈통 이다. 이스라엘 사람 들 은 우리 의 조상 들 이었다'." # AI Tags
