bno_random_0023.desc: "'오! 얼마나 많은 술을 마시는지 조심하세요'. 술집관은 웃음거리는 웃음거리로 말합니다. 당신의 왕국의 왕자로서, 당신은 대중의 눈앞에서 절대 과도한 소비에 집착하지 않을 것이라는 것을 알고 있습니다. 그것은 경고가 적었고, 더 많은 농담이었습니다. 그 다음에는 다른 한 잔의 집 맥주, 그리고 다른... 그리고 다른 한 잔을 보내달라고 요청되기 전에. 기억하세요, 이것은 당신이 손님들을 초대했을 때 마시는 분홍색 와인이 아니라 거의 산성 맛있는 음료였습니다. 그리고 당신의 옆에있는 남자는 당신을 더 많은 것을 요구했습니다.\n\n바텐더가 술 한 잔을 지연한 후 왜 멈추지 않았는지 몰랐어요. 당신은 계속 동전을 고 있었음에도 불구하고. 어쩌면 당신이 gipstered 하고 비밀을 퍼뜨리고 싶어하는 입찰의 혼합이었을지도 모릅니다. 또는 어쩌면 그는 당신의 궁극적인 규칙 때문에 온화하지 않았습니다.\n\n'올라, 그럼'. 그는 거의 빈 타버에 있는 남들보다 더 어두운 피부로, 그리고 많은 색채로 따돌린다. '나는 당신이 '다른'을 가질 수 없다고 확신한다'. 그는 미소를 짓고 당신을 위해 카운터에 누르며, 바르크퍼를 보고 빈 잔을 들고 있다. '올라! 그 여인은 또 다른 것을 원한다!'\n\n모든 것은 미묘한 색의 혼합이었습니다. 당신은 계속 음료수를 찌르고, 찌꺼기 찌꺼기 찌꺼기 찌꺼기 찌꺼기 찌꺼기 찌꺼기 찌꺼기\n\n'나는 그녀를 데려 갈 수 있는 방이 있습니까?' 당신은 단지 당신이 계단으로 가득 차 있기 전에 듣고, 그리고 로컬 타베른의 몇 안 되는 방 중 하나를 입력." # AI Tags
