bno_random_0024.title: "밤 에 도둑 처럼" # AI Tags
bno_random_0024.desc: "당신 의 궁중 의 일 한 사람, 당신 의 명예 를 자랑 하는 스파이 마스터 의 일원 은 당신 의 궁중 에 관련 된 몇 가지 비밀 을 보상 으로 교환 하기 위해 밤 의 표면에 당신 을 만나기로 합의 한 것 이다. 당신 의 궁중 에 있는 화석 아코 아래 에서 당신 의 궁중 에 있는 화석 아코 아래 를 기다리고 있으며, 당신 의 시간 을 지나가는 동안 발 을 밟고 있습니다.\n\n몇 분 이 지났을 때, 당신 의 오른쪽으로 발자국 이 흐르는 것을 들으며, 즉시 당신 의 눈을 돌리게 하고, 당신 의 거리에서 몇 미터 떨어진 곳에 서 있는 위장 한 인물을 볼 수 없게 됩니다. 사실, 적대적 인 의도를 가지고 있었다면, 그는 쉽게 폭격하여 이 땅 에서 당신 의 시간을 끝낼 수 있었습니다. 그 대신, 그는 자신의 위장 을 벗어났고, 정보를 가지고 있는 외국인으로 자신을 드러냈다.\n\n'그리스도!' 당신은 시끄럽게, 그의 갑작스러운 출현은 당신의 낮빛을 두려워합니다. 당신의 가슴을 포착하고, 당신은 일어납니다. [target1.GetFirstName] '무엇을 가지고 있습니까?' 당신은 그에게 묻습니다. 스파이는 정보를 공개하는 데 시간을 낭비하지 않습니다.\n\n불행히도, 내가 아는 것은... 당분간은 그것뿐입니다. 지불금에 관하여는... 그는 물러나, 자신의 자세를 정렬하고, 그의 옷장을 먼지를 벗고, 그의 아름다움은 여전히 희미한 빛에 눈에 띄는.\n\n'물론'. 당신은 빨리 대답, 당신의 엉덩이에서 동전 봉지를 끌어, 그를 위해 그것을 들고.\n\n'돈이야?' 그는 웃으며 머리를 흔들고, '나는 더... 가시적인 것을 원한다'. [target1.GetFirstName]손을 어깨에 올려놓고 압축을 하고 '당신의... 몸'." # AI Tags
