bno_random_0025.title: "나쁜 시간" # AI Tags
bno_random_0025.desc: "당신 은 이렇게 늦은 시간 에 혼자, 경비대 없이 밖에 나가는 것 은 나쁜 생각 이 아니라는 것 을 알고 있었습니다. 당신 의 도시 의 거리가 초대 한 모든 난민 들 에게 더욱 배신적 인 것 을 알고 있었습니다. 당신 의 느슨 한 의류 선택 이 약간 도발적 인 것 을 알고 있었습니다. 하지만, 그 어느 것 도 당신 의 출퇴근 시간 을 거쳐서 타파리 를 고칠 것 을 막지 않았습니다.\n\n그것은 또한 부끄러운 일이었습니다. 당신이 찢은 타페스트리는 상속품이었으며, 흙과 진흙 경로를 걷고 다니는 동안 당신의 마음이 생각할 수 있었던 것은 그것뿐이었습니다. 사실, 당신은 당신의 고통에 너무 관여하여, 당신이 뒤에 여행하는 래그타그 밴드를 알아차리지 못했기 때문에, 세 명의 남자가 당신을 뒤따르고, 그 곡선 엉덩이들이 옆으로 흔들리는 것을 지켜보고 있었습니다. 각자는 당신의 뒷면의 윤곽에서 당신의 시끄러운 드레바 리버럴을 바라보고 있었습니다. 그들 중 한 명이 당신을 잡을 때까지는 동안 당신은 그들을 알아차리지 않았습니다. 잠시 멈추고 돌아서 - 그들을 잡을 수 있는 충분한 시간을 제공했습니다.\n\n'아봐, 작은 덩어리'. 그 중 한 사람 이 튀어나오면서 당신 에게 물결 을 던지고, 더 어두운 피부 를 가진 한 사람 은 당신 의 옆구리 에서 서둘러 당신 의 엉덩이를 만지고 있습니다. 그 순간 이 외국인들이 당신 에게 원하는 것 - 돈 이나 성관계 - 을 깨닫습니다.\n\n'올라, 긴장하지 마, 가자'. 그 중 한 명은 웃으며, 여러분들 모두가 나뭇가지의 골목으로 내려갈 것을 촉구합니다. 그의 명령을 따르고, 여러분은 이제 모든 측면에서 둘러싸여 있습니다." # AI Tags
