bno_random_1025.title: "나쁜 시간: 골목 도로 의 하천" # AI Tags
bno_random_1025.desc: "당신 옆 에 있는 두 마리의 어두운 피부 의 들 은 당신 을 내려다보며 웃으며, 당신 이 활발 하게 표시 한 틈새 에 대해 놀라운 광경을 보며, 당신 이 걷고 있는 동안 무작위로 흔들리고 있습니다. '무적 인 대가를? 그렇게 말 할 수 있습니다'.\n\n'여보세요. 이건 좋네요'. 당신 앞에 있는 남자가 당신 앞의 바지를 떨어뜨리기 전에 명령없이 밖으로 내보내고, 이미 반 단단한 뚱뚱한 검은 똥구리를 들고 돌아갑니다. '이 작은 흰 토끼에게 왜 창녀처럼 걷지 않는지 보여주자'. 그는 이미 그의 똥을 끌고 있는 손으로 말합니다. 당신이 익숙한 것보다 쉽게 세 배가 됩니다.\n\n놀랍게도, 당신 은 보복 을 하지 않으시죠. 그 들 의 지도자 는 거대 한 똥 을 들고 지나가고 있습니다. 무릎 을 꿇고, 다른 두 사람 이 옷을 벗기 시작 하면서 당신 의 얼굴 앞 에서 그 똥 을 매달아 놓습니다. 그리고 당신 의 부유 한 섬유 를 찢어 뜯어 뜯어 뜯어 뜯어 뜯습니다.\n\n비록, 당신 이전의 남자가 그의 똥을 들어 올리고 당신의 턱에 가볍게 박을 때, 덜 신경 쓸 수 있다는 것은 분명합니다. '당신은 똥에 대한 작은 창녀입니다, 아?' 그는 당신에게 묻습니다, 그의 팁을 당신의 입술에 붙이기 전에, 응답을 기다리지 않고, 당신의 가슴에 손을 가서 젖은 가슴을 flopping.\n\n그 와중에 다른 둘은 네 옷 을 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어 뜯어\n\n'당신은 운이 좋습니까? 당신은 당신의 성에 이것을 얻지 못할 것 같습니다'. 그들 중 한 명은 당신이 누구인지 알고 있다는 것을 드러내며 따돌리고 있습니다. 그럼에도 불구하고, 당신이 대답할 수 있는 유일한 것은 불평입니다. 당신 아래의 남자가 당신의 뱉을 것을 윤활제로 사용하여 자신을 엉덩이에 강요합니다. 같은 혈관으로, 다른 사람이 당신의 입에 침입하여 당신의 머리를 강요하고, 세 번째는 부드럽게 당신의 뱉은 꽃에 들어갑니다. 'Fuuuuckkk...' 그들은 모두 짖고 짖고, 당신의 구멍은 그들을 위해 악성 같은 것입니다. 그러나, 그들은 당신이 협조하고 있다는 것을 이해하고, 그들의 가혹한 때림이나 두드러움을 억제합니다. 아래의 남자는 당신의 가슴을 만지고, 당신의 엉덩이에있는 사람이 당신의 엉덩이 들면서 당신을 긁어내며, 당신의 머리카락을 묶고, 세 번째는 당신의 머리카락을 붙잡고 있습니다.\n\n'여기 가구!' '그 똥을 가져가라'. 'Nghhmmm... 젠장 꽉 차라'. 그들은 조용하게 골목에서 을 계속합니다. 그들의 근육 몸은 밤에 숨겨져 있고, 당신의 은 육체는 뚜렷하게 보인다. 당신이 처리 할 수 있는 것은 첫 번째 똥이 당신의 똥에 부딪혀서 씨를 가득 채우기 전에 똥구멍 slurps 및 gags입니다. '어젠장!' 그는 을, 당신의 목에 있는 사람이 팝으로 끌기 전에, 당신이 숨 쉬는 것을 허용합니다.\n\n'내가 이 개새끼를 게 해줘요. 너 너무 귀여웠어'. 그는 웃고, 네가 계속 엉덩이에 굴고 귀를 고 있는 남자로 자리를 잡고 있다. 네 다리 사이에, 또 다른 사춘자가 들어와서, 그 씨앗을 네 흰 똥에 다시 넣고, 이번엔 물러나지 않는다. 그는 즉시 기 시작하고, 네 목을 둘러 싸기 위해 손을 들어 올리고, 이미 소모된 개새끼가 돌아다니며 네 얼굴과 머리카락에 그의 똥을 긁는다.\n\n'너가 거칠게 하는 걸 좋아한다는 걸 알아'. 네 밑에서 있는 남자 는 네 가슴 을 짝짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝 짝