bno_random_2025.desc: "네 감각은 모두 도망쳐야 한다고 소리치고 있습니다. 이 마을에서 도망쳐서 적어도 밤 경비대가 순찰하는 곳으로 갈 수 있도록 노력하세요. 아드레날린은 위험한 만남에서 심장이 뛰고 있는 몸으로 흐르고 있습니다. 네 사람은 골목으로 들어가면 앞의 남자를 지나가면서 도망가기 시작합니다. 신발은 젖은 진흙을 잡고 들어가서 좋은 출발을 할 수 있습니다. 빨리, 당신은 속도를 올리고, 그가 반응할 수 있기 전에 사람을 지나가기 시작합니다.\n\n'헤이!'라고 한 사람 들 은 도망 을 시작 하기 전 에, 당신 을 암흑 한 골목 에서 쫓아다니고 있다. 당신 은 당신 을 사냥 하는 동안 그 들 의 짖는 소리 를 듣고 머리를 돌리지 않을 것 이다. 불행 히도, 그 들 은 그것 을 위해 만들어진 것 이다. 우월 한 품목 과 건축. 당신 은 그 반대 끝 에 도달 할 수 있기 전 에, 외계인 들 중 한 명 은 당신 을 찌르고, 당신 의 어깨 에 따라 아래로 끌고, 두 사람 을 젖은 땅 에 쓰러지게 강요 한다. 당신 은 짖는 것 이다. 큰 발가락 이 당신 의 입 을 덮기 전 에 짧은 시간 에 한 소음 을 내놓는 것 이다.\n\n'무지한 창녀!' 너 위 에 있는 한 사람 은, 다른 손 이 내려오기 전 에 네 얼굴 에 딱딱 한 을 씌우며, 너 위 에 어느 정도 의 감각 을 부어 넣는다. '우리 를 잡으라!' 그는 속삭여, 너 는 글을 쓰고 휘어지는 동안에도 네 입 을 닫고, 너 를 해방 시키려고 한다. 다른 두 사람 은 올라오며, 한 사람 은 네 팔 을 잡고 땅 을 찌르며, 다른 사람 은 길거리의 끝 으로 눈을 돌리고, 감시자 역할을 한다. 너 위 에 있는 사람 은 네 시선 에서 그 의 바지를 끌어내기 시작 하고, 눈물 은 갑자기 고통 으로 인해 네 을 흐르기 시작 한다. 네 의복 을 고, 그는 뒤로 물러나고, 네 의복 을 잘 보고 있다.\n\n'어젠장... 적어도 이 엉덩이는 멋지다'. 그는 웃고, 가벼운 박수를 주고, 당신의 엉덩이를 찌르기 전에 그의 똥을 지시합니다. 그의 똥에 침을 찌르며, 그는 그것을 마찰합니다. 당신의 똥구멍을 닦을 수 있도록 약간의 윤활유가 있을 수 있도록 허용합니다. '당신이 원하는 만큼 소리 지르십시오'... 그는 속박하게 말합니다. 당신의 입술은 서서히 그의 똥구리를 덮고, 당신의 몸 전체에 모순적인 신호를 보내고 있습니다. 당신은 그를 따뜻하게 환영 할 때, 당신의 열이 그의 주위에 포장됩니다. 처음에는 그는 천천히 시작합니다. 골목 끝에 있는 남자가 손을 신호를 내리기 전에.\n\n'누군가 오고 있어!' 그는 속삭이고, 당신의 패배한 몸이 땅에 어, 경비자 시야에 따라 속도를 올리고. 바로 그렇게, 아프리카인이 당신의 똥을 열고 서둘러, 극단적인 편견으로 당신의 구멍에 어.\n\n'아와, 가자, 가자, 가자, 가자...' 그는 호흡 아래서 속삭이는 동안 그의 파트너가 당신에게 약간의 가벼운 박수를 주며, 당신이 완전히 복종하는지 확인합니다. '어젠장, 이 거미를 깨라'. 그는 다시 자그마합니다. 그는 당신을 도는 동안 당신의 입에 몇 손가락을 강요하고, 그의 리듬이 을 때 깨집니다. 그는 머리를 숙이고, 당신을 을 끝내고, 당신의 거미가 그의 팔꿈치처럼 행동하는지 확인합니다. 꺼내면, 그는 당신의 얼굴에 단단한 박스를 주며, 당신을 주진하게 만들고 그들이 달리는 동안 흙에 당신을 남겨줍니다." # AI Tags
