bno_random_1028.desc: "[target1.GetFirstName]당신의 연애를 보고 웃고, 머리를 숙여서 당신과 동의하고, 얼굴에 큰 미소를 짓습니다. '그건 당신이 감당할 수 있다면, 당신의 엉덩이도 할 수 있을 것 같다'.\n\n'우리 를 혼자 두는 것 은 어때요?' 는 것 을 조용히 물으실 것 이다. 그 들 은 빠르게 들으며, 자기 들 의 물건 을 들고 정원의 가장자리 로 향 하고 있습니다. 시야 에서, 하지만 귀 에 닿지 않는 것 이다. 당신 의 계획 을 파악 하는 것 처럼, 당신 앞 에 있는 사람 은 미소를 짓고, 그의 손 들 은 평온 한 물 아래 에서 조금 더 탐구적 인 것 이다. 하나는 당신 의 위 위 를 떠돌고, 다른 하나는 당신 의 뒤쪽 으로 더 멀리 떠돌고 있다.\n\n'무슨, 그들이 튀어나오기를 원하지 않나요?'[target1.GetFirstName]손은 가슴에 올라서서 잠시 짜증나게 하고 팔꿈치 아래로 돌아다니며 당신을 붙잡습니다. 껴안고, 당신은 그의 신체성을 보답합니다. 두 개의 작은 손은 그의 가슴을 찾고,\n\n'아니요... 그냥 그들이 질투하기를 원하지 않아요'. 당신은 메울을 하고, 첫 번째 움직임을 결정하고, 그의 입술에 씹을 수 있도록 기울이고, 지휘를 잡습니다. 그가 무장하지 않은 상태에서 그를 착취하고, 당신의 혀는 그를 침략하고, 그가 무슨 일이 일어나고 있는지 깨닫기 전에 잠시 그를 상대로 싸우고 있습니다. 그의 강한 부착 두 가지가 당신의 등에 올라가고, 자신의 다리 힘을 사용하여 수영장의 외부 부두로 당신을 밀어냅니다.\n\n'이 모든 것을 당신만을 위해 원하십니까?'[target1.GetFirstName]로토리적으로 묻습니다. 그의 두 팔이 당신을 포착하고 그의 손 안에 있습니다. 비록, 그것은 분명히 당신을 괴롭히지 않는 것처럼 보이지만, 잠재적인 간음에 놀고 있습니다. 당신의 혈통을 배신하면, 당신은 함께 놀고 있습니다. 두 손은 그의 가슴을 회피하고, 그 대신 그의 셔츠에 초점을 맞추고, 그의 프레임을 아래로 작업하는 데 좋은 진전을 이루고 있습니다. 당신이 다리를 절반으로 떨어뜨릴 때, 그는 콧물, 그의 입술에 속박한 미소, 마찰을 즐기고. '이렇게 천천히 계속하고, 나는하지 않을 것입니다'. 그는 웃고, 당신이 빨리 그의 똥의 마지막 인치를 드러낼 수 있습니다. 심지어 물의 빛의 굴절 왜곡. 당신의 손 중 하나는 그의 똥을 만지고, 당신의 얼굴에 보이는 미소감은 몇 분 동안 그를 느낄 수 있습니다.\n\n'네... 둘 중 누구도 이걸 훔치는 건 싫어요'. [target1.GetFirstName]더 나아가서 웃고, 당신의 턱에 손을 들어주고, 엄지손가락이 당신의 입까지 떠돌아다니고, 조용히 입구를 요청하고, 다른 사람은 물 아래에서 놀고, 당신의 수영장 의상을 한쪽으로 끌어들이고 있습니다.\n\n'걱정 마시오. 주변을 돌아다니는 게 많았을 것 같아요'. 그는 속삭이고, 당신의 발 사이를 안내하는 동안 그의 똥이 숨어있으며, 당신의 갈라짐을 느낄 수 있게 해줍니다. 당신은 조금만 불평합니다. 그는 당신의 발 사이에서 손을 잡고 자신을 안내하는 동안. 쉽게, 그는 속삭이고, 당신의 똥이 그의 크기와 색깔의 남성에게 익숙해집니다. '악마. ' 그는 니다. 그는 당신에게 밀리면서 몇 가지 어려움을 겪으며, 엄지 손가락이 당신의 입을 완전히 통제하도록 허용합니다. '당신은 '무더기'입니다. ' 그는 가난한, 찌꺼운 맛으로 장난합니다.\n\n하지만, 당신은 웃을 수 없고, 엄지손가락을 고, 혀를 고, [target1.GetFirstName]그의 눈, 당신의 손, 무엇을 해야할지 확실하지 않은 그의 가슴을 보면, 당신은 그의 구조화된 가슴의 또 다른 좋은 감각을 얻을 수 있습니다. '젠장... 아빠... ' 당신은 아쉽게 니다.\n\n'Shhhh...' 그는 빨리 대답하고, 당신을 침묵시키고, 당신이 그를 아먹는 것처럼 젖을 도록 허용합니다. ' 그냥... 그것을 가져'. [target1.GetFirstName]삐걱거리고, 몸을 뒤쪽 벽에 부딪히고, 물이 파로 무너지고, 우선, 그는 숨쉬고, 당신의 무죄를 엿먹고, 무례하게 당신을 꽉 찼다가," # AI Tags
