bno_random_1030.desc: "[target1.GetFirstName]당신의 갑작스러운 관심에 놀랐습니다. '남자의 해부학?' 그는 질문, 그의 가시적인 붓을 내려보고, 그리고 다시 당신에게, 당신의 호기심이 열렬하게 당신의 얼굴에 표시. '좋아요, 검은 해부학은 흰색과 약간 다릅니다'. 그는 추가, 카운터에 뒤로 기울여, 그의 눈이 조금 furrowed 지금. '나는 sho-'\n\n' 제발요'. 다시 말해주세요. 목소리에서 간청하는 목소리만 들어요. 네 눈은 마치 도인처럼[target1.GetFirstName] '남자의 해부학'을 설명하기 위해서\n\n[target1.GetFirstName]스카프, 입술에 작은 미소, 엉덩이에 손을 넣고, 그의 바지에 엄지손가락을 뚫고 서서히, 그는 그의 바지를 끌어내기 시작, 그의 긴 바지를 바지에 뛰는 느낌. '좋아요'... 그는 후퇴, 그의 바지를 다리 아래로, 그의 트렁크[bno_bbc|E]그의 정맥이 팽창하고 그의 석탄줄기 아래로 흐르고 서서히 점점 더 많은 나무를 드러내고 있습니다. 그것은 분명히 어렵지 않습니다. 그는 그의 끝으로 가까이 다가오고, 분명히 색이 변하고 있습니다. 당신을 보고, 그는 웃고, 당신의 표현이 자유롭고 느슨하고 무거운\n\n당신은 소리없이 숨쉬지 않지만 입이 열립니다. [target1.GetFirstName]방은 조용합니다. 당신은 그것을 쳐다보며, 의사의 손이 뒤로 물러나서, 그를 괴롭히고, 박을 때리고 뛰게 합니다. 손가락은 그의 똥을 따라 내려가며, 똥이 올라가는 것을 지켜볼 수 있습니다. 초에 초에 그의 발기 조직이 단단해지고, 매달리는 대신 서서히 굳어집니다. 두꺼운, 육성, 카카오 색의 똥은 당신의 앞에 빛납니다. 그 전에 그의 바지를 다시 꽉 차 있습니다.\n\n'이제... 당신의 반사'." # AI Tags
