bno_random_2030.desc: "[target1.GetFirstName] '좋아요'. 그는 손을 내밀기 시작했고, '이런 일을 빨리 해봅시다. 더 많은 검사를 해야 합니다'. 남자가 말했습니다. 그의 불가능한 큰 똥이 자유로울 때, 당신을 맞이하기 위해 뛰고, 이미 당신의 가슴의 '검사'와 사용된, 때린 똥의 탐구로 인해 반 딱딱합니다.\n\n스니커, 테이블에 누워서, 속옷이 아직 내려지고 발목을 돌고, 발이 다리를 벗기려고 하고, 드레스는 몸 위로 올라와, 너보다 더 어두운 남자에게 자랑스럽게 포기한 상처와 박힌 똥을 보여준다[target1.GetFirstName] '나는 쉽게 할 수 없어. 당신이 처리할 수 있을 것 같다'. 그는 삐걱거리고, 그의 맥박하고 단단한 이 당신의 배에 머물기를 갈망하면서 학대를 지적합니다.\n\n'무엇이든 더 빨리 끝낼 수 있게 해줍니다'. 당신은 미소 짓고, 네 다리를 붙잡고 있는 동안 그 밑에 거리고, 그의 똥은 이미 엉덩이를 사용해서 네 쪽으로 인도할 정도로 단단해져 있습니다. 물론, 당신은 충분히 뻗어 있고, 그의 똥은 젖은 똥으로 쉽게 슬라이드 되고, 에본이 된 덩어리를 삼키고 있습니다. 당신이 자신의 고발한 울음과 비교할 때, 편안한 웅거리는 그를 떠나고, 두 껍질도 비슷하게 대립합니다.\n\n'이건 좋은 똥이야'. 그는 속삭이고, 당신을 밀어내고, 빠른 시일 내에 바닥에 떨어지고, 당신을 뚫고 튀어나오며. '당신은 그들을 미친 짓으로 몰아넣는 것은 놀라운 일이 아니다'. [target1.GetFirstName]그의 두 손은 당신의 가슴에 짜릿한 손잡이를 주고, 또 다른 약한 비명을 강요하고, 아래로 내려다보며, 웃으며, 그의 거란 똥으로 당신의 배가 튀어나가는 것을 보고, 그의 아프리카적 우월성은 당신을 찢어내고 있습니다.\n\n'엄마~ 넌 너무 좆같은 거대야'. 넌 울고, 네 발가락을 굽히고, 그가 너한테 더 깊게 다가오면서, 네 G 점을 고, 그로부터 몇 가지 똥이 나오고. 네 의사는 빨리 너를 자신의 개인 매춘부로 만들고, 그의 검은 수컷의 똥구멍에 똥구멍을 넣고. 네 가슴을 짜증나게 고, 그 젖은 가슴에 몸을 기울이고, 상당한 시간 동안 각각에 젖을 고, 그럼에도 불구하고 너를 똥구멍으로 바꾸는 데 그의 진전을 저해하지 않고. 결국, 네 내 엉덩이는 이미 네 수액으로 빛나고 있었고, 지금, 그의 수컷은 네 여성적인 넥터로 미끄러져 있다.\n\n'먹은 창녀'. 그는 콧수염을 고, 가슴이 격렬히 흔들리고 아래로 흔들리는 것을 보고, 한 손이 내려가서 배에 압력을 가하고, 당신의 쾌락을 증폭시킵니다. 당신의 눈은 넓어지고, 더 강한 에게 비참하게 굴복하고, 당신의 몸이 축축되고, 이 그를 둘러싸고, 그의 똥을 질식하고 있습니다. '똥!' 그는 고, 당신의 가슴에 손을 넣어 당신의 입에 비추고, 당신의 비참한 비명을 침묵하고 있습니다. '잠깐만 닥쳐라'. 그는 콧수염을 고, 고, 방을 'PLAP PLAP PLAP'으로 채우고, 그의 공은 당신의 엉덩이에 clapping. '나는 cumming입니다'. [target1.GetFirstName]그 대신, 그의 유전적 데이터의 절반은 당신의 똥에 던져집니다. 그의 똥은 폭력적으로 당신의 하부 에 몇 개의 끈을 쏘고, 그의 지배력을 묘사합니다.\n\n너희 둘 다 윙윙 윙 윙 윙 윙 윙 윙 윙 윙 윙 윙 윙 윙 윙 윙 윙 윙 윙 윙\n\n'세탁을 즐겨 해, 창녀야'." # AI Tags
