bno_random_0036.desc: "당신의 마음은 현재 파괴된 똥에서 활발하게 유출되고, 침의 형태로 입술에서 dribbling하는 빈 스윙일 뿐입니다. 사실, 당신이 일관된 문장을 형성 할 수 있다면, 그것은 기적의 전부가 될 것입니다. [target1.GetFirstName]입에 손가락을 꽂고, 엉덩이를 치거나 뭐든.\n\n'네... 네... 좆같은 창녀야'. [target1.GetFirstName]오늘 밤 오르가즘에 도달하지 못했지만, 5분도 안 되는 시간 안에 그는 당신을 깨뜨렸어요. 25분도 안 되는 시간 안에 두 번 오르가즘이 일어났습니다.\n\n'아빠, 조심해!' 넌 울고, 침대에서 돌아다니며, 엉덩이에서 돌아다니며[target1.GetFirstName]침대에 서서히 올라서서 당신을 향해 나아갔습니다. 당신은 완전히 동의했지만, 당신은 그가 겁에 질리고 지나가는 것을 지켜봤습니다. 그의 거대한 똥이 옆에서 옆으로 흔들리고 있습니다. 그는 당신의 다리에 니다. 탈출할 수 없다는 것을 보여주며, 당신의 똥에 혹독한 박을 내기 전에, 당신을 고통스럽게 만듭니다. 남자는 당신의 똥을 고, 그의 똥을 만지고, 당신의 고양이에게 몇 가지 편안한 똥을 습니다.\n\n'당신의 와인에 있는 애프로디시안이 실제로 이렇게 잘 작용할 줄 누가 알았을까?'[target1.GetFirstName] '하지만, 좆까... 넌 말 그대로 찢어졌어. ' 남자가 생각하며, 손을 들고 얼굴에 박을 때리고, 손을 집어 넣기 전에, 그의 손은 주머니를 지배적으로 잡고. '말해줘, 넌 찢어졌어'.\n\n'나는 깨지고 있어요'...\n\n'네가 뭐야?'\n\n'그냥 멍청한 돼지야'\n\n[target1.GetFirstName]얼굴에 박을 때면 주의를 끌고 '무엇을 섬기고 있소, 여보?'\n\n'B-black dick...I-I-I'm a queen of spades~' 당신은 삐걱거리고 무기력하게 돌아다니며, 당신의 가슴, 얼굴의 매끄러움, [target1.GetFirstName]또 다른 비참한 오르가즘을 요구합니다.\n\n'예수님. ' 그는 웃고, 당신을 끌어당기고, 당신의 똥을 치고, 당신의 허벅찬 울음소리와 함께 뱉는 것을 지켜보고 있습니다. '당신은 상처받는 팬입니다... 그렇지 않습니까?'" # AI Tags
