bno_random_0037.desc: "블랙 을 먹지 않는 순간도 없었어요. 적어도 지금은 아니죠. 당신의 선호도는 당신의 흑인 궁중들 사이에서 공개적으로 공유되었기 때문입니다. 그들은 공개적으로 당신을 공유하고, 기차를 타고, 당신을 지나가며, 당신의 몸과 영역에 대해 그들이 좋아하는 일을 했습니다. 결국, 그들은 당신이 봉사해야 할 모든 용서를 줄 것을 알고 있었습니다. 그리고 보이우리즘은 예외는 아니었다. 사실, 그것은 당신의 좋아하는 과거 중 하나입니다.\n\n'젠장, 젠장... [target1.GetFirstName]엿먹은 - 바로 거기! ' 당신은 큰 소리를 질러, 야생의 공기가 당신의 외침을 감추기 위해 거의하지 않습니다. [target1.GetFirstName]네 다리 사이에 묻혀 있고, 네 방위없는 거미를 뜯어내고 있어[target2.GetFirstName]당신의 얼굴의 자유 통치, 현재 당신의 머리카락을 묶고, 당신의 턱은 이미 무어 콧물으로 어, 통제할 수 없을 정도로, 그의 두꺼운 똥 스틱이 당신에게서 인치 떨어져있는 것처럼. Discordia의 정원의 황금 사과처럼, 당신은 그것을 쳐다보고, [target1.GetFirstName].\n\n'하느님, 이 돼지는 입을 다물지 않아'. [target2.GetFirstName]한 손 으로 그의 똥 을 들어 올리고 얼굴 에 비웃는 몇 가지 조롱적 인 똥 찌꺼기를 전달 하기 전 에, 웃는 것 이다. 당신은 열렬히 그를 초대 하 고, 당신의 입을 열고, 당신의 혀를 펴고 당신의 입술로 그를 잡으려고 노력 합니다. '너도 너무 절망적 이다'. 그는 당신의 혀를 통해 그의 끝을 긁어, 그의 찌꺼기를 맛볼 수 있게 해줍니다.\n\n'네, 이제 내가 널 왜 여기 데려왔는지 알잖아'. [target1.GetFirstName]웃고, 엉덩이를 치고, 육류가 흔들리는 걸 보고, 주스가 그의 똥을 덮고. [target2.GetFirstName] '네 똥을 열고 있는 남자는 네 내면으로 끝나는 동안 치아를 긁어내고, 오르가즘의 반쯤에서 빠져나오며, 너의 똥이 똥처럼 그의 씨앗을 흘리는 것을 지켜보고, 너의 뒷면에 박수를 주고, 네 앞에 있는 남자가 바구니에 몸을 숙이고, 목탄을 낚아내고, 친구에게 던지는 것을 지켜보고 있다'. [bno_bbc|E]...거짓... '[target1.GetFirstName]돌이 엉덩이를 긁고 눈이 넓어지고 머리를 돌리고 트랜스를 깨고[target2.GetFirstName]좆이야" # AI Tags
