bno_random_0048.desc: "당신의 아내는 아프리카 궁정들에게 좋은 창녀입니다. 그녀는 의심 없이 그들의 큰 검은 똥을 기쁘게 하는 것을 좋아합니다. [target1.GetFirstName]하지만 당신은 아내와 그녀의 연인들과의 관계를 좋아해요. 그녀의 똥은 그 어느 때보다 뻗어있어요. 그래서 그녀는 당신을 더 이상 느낄 수 없습니다. 그래서 그녀는 아이디어를 가지고 있습니다. [target1.GetFirstName] '아뇨, 내 똥은 아쉽게 당신의 비참한 똥을 느낄 수 있습니다. 나는 단지 큰 검은 똥을 느낄 수 있습니다. 그래서 그것은 오줌을 하는 것 외에는 아무 쓸모가 없습니다. 나는 오늘 시장에서 발견 한 새로운 순결성 케이즈로 당신을 잠금하기로 결정했습니다. 그래서 당신은 더 이상 친밀감을 위해 init를 사용하지 않습니다. 나는 열쇠를 가지고있을 것입니다. 그리고 나는 당신이 다시 자유롭게 될 수있을 때 결정할 것입니다. 그리고 그것은 오래 걸릴 것입니다." # AI Tags
bno_random_0048.a: "알았어, 내 딸아, 날 구석에 넣어" # AI Tags


bno_random_0039.title: "덜 친화적 인 싸움" # AI Tags
bno_random_0039.desc: "저는 젊은 공주로서 두 기사 사이의 이 대결을 보는 것은 매우 매혹적이었습니다. 그 두 기사들의 몸의 움직임은 정말 매력적이었습니다.\n\n하지만 제가 정말 깜짝 놀랐던 것은 누가 승리할지는 분명해졌을 때였습니다. 기술력이나 기술 때문이 아니라 특정 영역의 크기 차이 때문이었습니다.\n\n그녀가 계속하는 동안 약간 붉어집니다\n\n저는 지금까지 모든 사람이 평등하게 창조된다고 가정해왔고, 이 두 가지의 극한의 대립을 보고 저는 남성 해부학에 대해 알고 있다고 생각했던 모든 것에 의문을 갖게 되었습니다.\n\n그럼에도 불구하고, 제 일부분은 다음으로 무슨 일이 일어날지 궁금했습니다. 특히 더 큰 기사도 여러 가지 방법으로 '승을 거둘 것'이라는 것이 분명해 보였다.\n\n얼굴에 무죄한 미소로 끝을 내기 전에 어깨를 습니다.\n\n난 아직도 이 세상에서 배워야 할 것들이 남아있지!" # AI Tags
bno_random_0039.a: "내 다른 기사들과 비교했을 때 그가 얼마나 큰지 알아내지 않을 수 없다!" # AI Tags
bno_random_0039.b: "이 공모전에서 승리한 대상은 내가 될 수 있을까?" # AI Tags
bno_random_0039.c: "저는 이 দ্বন্দ্ব을 즉시 중단하라고 명령합니다!" # AI Tags

bno_random_2039.title: "덜 친화적 인 격투: 편을 선택" # AI Tags
bno_random_2039.desc: "심히 숨쉬고 게 빛나는 경로로 내려가기 전에 용기를 얻습니다.\n\n에라라 는 성 의 경로 를 뚫고 튀어나오면서 별 소리 를 내지 않으려고 노력 하고 있는 가운데 달 이 하늘 에 솟아 있는 것 이다. 그녀는 이 곳 으로 오는 것 으로 잡히면 지옥 이 될 것 을 알고 있지만 더 이상 그 충동 에 저항 할 수 없다.\n\n검은 기사자의 방 문에 도착하고 잠시만 망설이고 부드럽게 문을 두드리기 전에\n\n그 사람 이 책 을 열자마자, 그녀는 초청 을 기다리지 않고 안으로 들어갑니다. 그녀의 심장이 그녀의 귀에 너무 크게 뛰고 있어, 그녀는 거의 명확하게 생각할 수 없습니다.\n\n두 사람 사이 의 긴장 은 그 들 이 방 을 가로지르며 서로를 바라보고 있을 때 가시 로 느껴진다. 두 사람 은 가슴 에 열렬한 욕망 을 품고 있을 뿐 이다.\n\n마침내, 엘라 는 더 이상 견딜 수 없게 되었으며, 부드러운 음 으로 자기 를 그 남자 에게 압력 하고, 그 의 손 들 은 그 의 셔츠 아래 에 들어가서 그 의 복부 를 거쳐 있는 모든 근육 의 파동 을 느낄 수 있습니다.\n\n' 제발... '그녀는 그의 목에 서둘러 속삭여, '나는 당신을 너무 많이 필요로..." # AI Tags
bno_random_2039.a: "제가 본 적에서 가장 강렬하고 정신을 끄는 섹스였어요" # AI Tags
bno_random_2039.b: "난 당신의 라이벌이 제대로 처벌받을 수 있도록 하겠다 그리고 그가 곧 감옥에서 나오지 않을 것이라고 말할 때 나를 믿어." # AI Tags

bno_random_0040.title: "[ROOT.Char.GetFirstName]비극적 발견: BBC 툴의 어두운 비밀" # AI Tags
bno_random_0040.desc: "내가 내 방에 앉아있을 때, 뉴스는[target2.GetFirstName]그의 죽음은 저를 만났습니다. 그는 수년 동안 저를 잘 섬긴 충성스러운 궁정관이었다는 것을 깨달았을 때, 제 마음은 가라앉았습니다.\n\n하지만 그때, 제 머릿속에는 무언가가 떠올랐어요. [target1.GetFirstName]그들은 질투와 분노로 가득 차서 화를 나누었습니다.\n\n# 약한 나는 깊은 곳에서 그가 그들의 대결 후 갑자기 죽은 것은 단순한 우연이 아니라는 것을 알고 있었다. [target2]내 연애에 대한 분노로 내 궁중을 죽였어\n\n# 약한 생각으로 척추에 떨림이 쏟아졌습니다. # 매일 밤 침대를 나눈 사람이 그런 행동을 저질렀을 것이라고 생각하기는 거의 견딜 수 없었습니다. #!" # AI Tags
bno_random_0040.a: "나는 울고 있는 척하는 동안 크게 냄새를 맡는다" # AI Tags
bno_random_0040.b: "오[target1.GetFirstName]좀 더 단단히 붙잡아줘요!" # AI Tags
bno_random_0040.c: "내 궁중을 죽인 건 너였어" # AI Tags
